import React from 'react';

const Header = ({ user, email, password, setEmail, setPassword, handleSignIn, handleSignUp, error }) => {
  return (
    <header style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', padding: '10px 20px', backgroundColor: '#f8f9fa', borderBottom: '1px solid #ddd' }}>
      <h1>My App</h1>
      <div style={{ display: 'flex', alignItems: 'center', gap: '10px' }}>
        {user ? (
          <div style={{ display: 'flex', alignItems: 'center', gap: '10px' }}>
            <p>Welcome, {user.email}</p>
            <button onClick={handleSignOut} style={{ padding: '5px 10px', backgroundColor: '#dc3545', color: '#fff', border: 'none', borderRadius: '5px', cursor: 'pointer' }}>
              Sign Out
            </button>
          </div>
        ) : (
          <div style={{ display: 'flex', alignItems: 'center', gap: '10px' }}>
            <p style={{ margin: 0, color: '#666' }}>Sign in to store your data</p>
            <input
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              placeholder="Email"
              style={{ padding: '5px', borderRadius: '5px', border: '1px solid #ddd' }}
            />
            <input
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              placeholder="Password"
              style={{ padding: '5px', borderRadius: '5px', border: '1px solid #ddd' }}
            />
            <button onClick={handleSignIn} style={{ padding: '5px 10px', backgroundColor: '#007bff', color: '#fff', border: 'none', borderRadius: '5px', cursor: 'pointer' }}>
              Sign In
            </button>
            <button onClick={handleSignUp} style={{ padding: '5px 10px', backgroundColor: '#28a745', color: '#fff', border: 'none', borderRadius: '5px', cursor: 'pointer' }}>
              Sign Up
            </button>
          </div>
        )}
        {error && <p style={{ color: 'red', margin: 0 }}>{error}</p>}
      </div>
    </header>
  );
};

export default Header;
